import react from "react"
import './App.css';

function App() {
  return (
    <main>
      <div className="container">
        <h1 className="appHeading">MoneyTracker</h1>
        <div>
          <input type="text" placeholder="-200 samsung tv" />
          <input type="datetime-local" placeholder="time" />
        </div>
        <div>
          <input type="text" placeholder="description" />
        </div>

      </div>
    </main>
  );
}

export default App;
